import Menu from '../assets/images/menu.svg';
import React, {useState} from "react";

export default function NavBar(){
    const [open, setOpen] = useState(false);
    return(
        <div className='fixed top-0 left-0 w-[120px] h-full bg-white flex flex-col py-8 z-[9999]'>
            <div className='flex_center'>
                <button className='w-[60px] h-[60px] flex_center' onClick={(event : React.MouseEvent<HTMLButtonElement>) => setOpen(!open)}>
                    {open ?
                        'asf'
                        :
                        <img src={Menu} alt={'menu'} width={40}/>
                    }
                </button>
            </div>
        </div>
    )
}
